import { useEffect, useState } from "react"
import { Link, useNavigate } from "react-router-dom"

function Header() {
  var [status, setStatus] = useState("undefined")

  useEffect(() => {
    setStatus(sessionStorage.status)
  }, [sessionStorage.status])

  const remove = () => {
    setStatus(undefined)
    sessionStorage.status = undefined;
  }
  const navigate = useNavigate();
  return <div className="container">
    <header className="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between py-3 border-bottom">
      <div className="col-md-3 mb-2 mb-md-0">
        <a href="/" className="d-inline-flex link-body-emphasis text-decoration-none">
          <img src={require("../Resources/logo1.png")} className="card-img-top" alt="..." />
        </a>
      </div>

      <div className="col-md-3 text-end">
        <button type="button" className="btn me-2">
          <img src={require("../Resources/wishlist.png")} className="card-img-top" alt="..." style={{ width: "30px" }} />
        </button>
        {/* <button type="button" className="btn btn-primary">Add to cart</button> */}
        <Link className="btn" to="/cart">
          <img src={require("../Resources/cart.png")} className="card-img-top" alt="..." style={{ width: "30px" }} />
        </Link>
        {(status === "undefined" || status === undefined) ? (
          <>
            <Link className="Logo" to="/signup">Sign Up</Link>
            <Link className="Logo" to="/login">LogIn</Link>
          </>
        ) : (
          <Link className="Logo" to="/" onClick={remove}>
            <img src={require("../Resources/signOut.png")} className="card-img-top" alt="..." style={{ width: "30px" }} />
          </Link>
        )
        }
      </div >
    </header >
  </div >
};
export default Header;
